import axios from 'axios';

const api = axios.create({
    baseURL: 'http://localhost:8000',
});

const registerUser = (data) => api.post('/users/register', data);
const registerEnterprise = (data) => api.post('/enterprises/register', data);
const login = (data) => api.post('/token', data);
const getFunFact = () => api.get('/fun-fact');  // Add the get request for the fun fact

export default {
    registerUser,
    registerEnterprise,
    login,
    getFunFact,  // Export the fun fact request
};
